import React from "react";
import EmptyCart from "../screens/EmptyCart.jsx";
import {Routes, Route} from "react-router-dom";
import AllProducts from "../screens/ProductCategories/AllProducts.jsx";
import CatProducts from "../screens/ProductCategories/Cats/CatProducts.jsx";
import DogProducts from "../screens/ProductCategories/DogProducts.jsx";
import Cart from "../screens/Cart.jsx";
import Checkout from "../screens/Checkout.jsx";
import Home from "../screens/Home/Home.jsx";
import ProductDetail from "../screens/ProductDetail/ProductDetail.jsx";


function Main() {
  return (
    <div className="main">
      <Routes>
        <Route path="/" element={<Home />} />
        <Route path="/products" element={<AllProducts />} />
        <Route path="/products/cat" element={<CatProducts />} />
        <Route path="/products/dog" element={<DogProducts />} />
        <Route path="/cart" element={<Cart />} />
        <Route path="/checkout" element={<Checkout />} />
        <Route path="/emptycart" element={<EmptyCart />} />
        <Route path="/product-details" element={<ProductDetail />} />
      </Routes>
    </div>
  );
}

export default Main;
